import { Component, OnInit } from '@angular/core';
import { LoguearService } from '../../service/loguear.service';
import { ExamenService } from 'src/app/admin/services/examen.service';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent implements OnInit {

  loggg : boolean = false
  salir : boolean = false
  listExamn : any;
  AdminFijo = localStorage.getItem('role')

  constructor(private loginName:LoguearService,private obtenerNombre:ExamenService,private router:rou) { }

  ngOnInit(): void {
    this.loginName.getOrganizacionId().subscribe(
      (data) => {this.loggg= data}
    )
    this.obtenerNombre.getExam().subscribe(
      (data)=> {this.listExamn=data}
    )
  }


  Salir(){
    localStorage.clear()
  }


}
